//SPDX-License-Identifier: MIT

pragma solidity ^0.8.19; 

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./uniswap/IV3UniswapSwapRouter.sol"; 
import "./pancakeswap/IV3PancakeSwapRouter.sol"; 
import "./chainlink/PriceAggregator.sol"; 

contract OptimusPrime {

error NotTheOwner(address sender); 

error NotTheTradeExecutor(address sender); 

error NoProfit(uint256 finalBalance); 

event Profit(uint256 _finalBalance); 

address private immutable owner; 

address public tradeExecutor; 

IERC20 public constant usdt = IERC20(0xFd086bC7CD5C481DCC9C85ebE478A1C0b69FCbb9); 

IV3UniswapSwapRouter public immutable uniswapRouter; 

IV3PancakeSwapRouter public immutable pancakeRouter; 

mapping(address => mapping(address => uint256)) private numberOfTokensApproved; 

constructor(address _uniswapRouter, address _pancakeswapRouter) {
uniswapRouter = IV3UniswapSwapRouter(_uniswapRouter);
pancakeRouter = IV3PancakeSwapRouter(_pancakeswapRouter); 
owner = msg.sender; 
}


modifier OnlyOwner() {
if(msg.sender != owner){
   revert NotTheOwner(msg.sender); 
  }
_; 
}

modifier OnlyTradeExecutor() {
if(msg.sender != tradeExecutor){
   revert NotTheTradeExecutor(msg.sender); 
  }
_; 
}



//DEPOSIT
function depositUSDT(uint256 amount) public OnlyOwner(){
require(amount > 0, "Amount can't be 0"); 
IERC20(usdt).transferFrom(msg.sender, address(this), amount);
}

//WITHDRAW
function withdrawUSDT(uint256 amount) public OnlyOwner(){
require(amount <= returnUSDTbalance(), "Amount is higher than balance"); 
IERC20(usdt).transfer(msg.sender, amount);
}



//TWO MAIN FUNCTIONS TO TRADE 
function buyWithUSDTFromPancakeV3AndSellToUniswapV3(IV3PancakeSwapRouter.ExactInputParams memory pancakeParams, address tokenToBuy, uint24 uniswapPoolFee, uint256 estimatedGas) public OnlyTradeExecutor(){
uint256 initialBalance = IERC20(usdt).balanceOf(address(this));

buyTokenWithUSDT_pancakeswapV3(pancakeParams);

IV3UniswapSwapRouter.ExactInputParams memory uniswapParams = IV3UniswapSwapRouter.ExactInputParams({
path: abi.encodePacked(tokenToBuy, uniswapPoolFee ,usdt), 
recipient: address(this), 
amountIn: IERC20(tokenToBuy).balanceOf(address(this)), 
amountOutMinimum: 0
}); 
sellTokenForUSDT_uniswapV3(uniswapParams);

uint256 finalBalance = IERC20(usdt).balanceOf(address(this)); 
if(finalBalance < (initialBalance + estimatedGas)){
 revert NoProfit(finalBalance); 
}else{
  emit Profit(finalBalance);
}
}


function buyWithUSDTFromUniswapV3AndSellToPancakeV3(IV3UniswapSwapRouter.ExactInputParams memory uniswapParams, address tokenToBuy, uint24 pancakePoolFee, uint256 estimatedGas) public OnlyTradeExecutor(){
uint256 initialBalance = IERC20(usdt).balanceOf(address(this));

buyTokenWithUSDT_uniswapV3(uniswapParams);
IV3PancakeSwapRouter.ExactInputParams memory pancakeParams = IV3PancakeSwapRouter.ExactInputParams({
path: abi.encodePacked(tokenToBuy, pancakePoolFee, usdt), 
recipient: address(this), 
amountIn: IERC20(tokenToBuy).balanceOf(address(this)), 
amountOutMinimum: 0
}); 
sellTokenForUSDT_pancakeswapV3(pancakeParams);

uint256 finalBalance = IERC20(usdt).balanceOf(address(this)); 
if(finalBalance < (initialBalance + estimatedGas)){
 revert NoProfit(finalBalance); 
}else{
 emit Profit(finalBalance);
}
}


//BUY TOKENS WITH USDT
function buyTokenWithUSDT_pancakeswapV3(IV3PancakeSwapRouter.ExactInputParams memory params) internal {
IV3PancakeSwapRouter(pancakeRouter).exactInput(params);
}

function buyTokenWithUSDT_uniswapV3(IV3UniswapSwapRouter.ExactInputParams memory params) internal {
IV3UniswapSwapRouter(uniswapRouter).exactInput(params);
}


//SELL USDT FOR TOKENS
function sellTokenForUSDT_pancakeswapV3(IV3PancakeSwapRouter.ExactInputParams memory params) internal {
IV3PancakeSwapRouter(pancakeRouter).exactInput(params);
}

function sellTokenForUSDT_uniswapV3(IV3UniswapSwapRouter.ExactInputParams memory params) internal {
IV3UniswapSwapRouter(uniswapRouter).exactInput(params);
}


//APPROVE TOKENS
function approveToken(address tokenToApprove, address spender, uint256 amount) public OnlyOwner(){
numberOfTokensApproved[tokenToApprove][spender] = amount; 
IERC20(tokenToApprove).approve(spender, amount);
}

//SET TRADE EXECUTOR
function setTradeExecutor(address _tradeExecutor) public OnlyOwner(){
require(_tradeExecutor != (address(0)), "Can't be a 0 address"); 
require(_tradeExecutor != address(this), "Can't be this address");
tradeExecutor = _tradeExecutor; 
}



//RETURN DATA, VIEW
function returnETHPrice() public view returns(int){
(/* uint80 roundID */, int answer,/*uint startedAt*/, /*uint timeStamp*/, /*uint80 answeredInRound*/) = 
PriceAggregator(0x639Fe6ab55C921f74e7fac1ee960C0B6293ba612).latestRoundData(); 
return answer;
}

function returnOwner() public view returns(address) {
return owner; 
}

function returnTokenApproved(address token, address spender)public view returns(uint256){
return numberOfTokensApproved[token][spender]; 
}

function returnUSDTbalance() public view returns(uint256) {
return IERC20(usdt).balanceOf(address(this));
}

function returnPathData(address tokenA, uint24 poolFee, address tokenB) public pure returns (bytes memory){
return abi.encodePacked(tokenA, poolFee, tokenB);
}

}

